import React from 'react';

class Footer extends React.Component{
  render() {
    return(
     <div className='footer'>
      <h4>活動場所</h4>
      <h5><a href="https://www.youtube.com/channel/UC-sM1Mg7n_C48Odq5Xz83KA">youtubeチャンネル</a></h5>
      <h5><a href="https://twitter.com/ChaosPalette_OF">公式twitterアカウント</a></h5>
      <h5><a href="https://twitter.com/Web510Game510">五戸アキのtwitterアカウント</a></h5>
      <h5><a href="https://twitter.com/SANADA_NoiR">真田幸成のtwitterアカウント</a></h5>
      <h5><a href="https://twitter.com/TACHIBANAKE_TA">立花ケヱタのtwitterアカウント</a></h5>
      <h5><a href="https://twitter.com/AIs36469011">永見こうきのtwitterアカウント</a></h5>
     </div>
   );
  }
}

export default Footer;
